CREATE FUNCTION antigen_demand(facility text) RETURNS TABLE(planned_demand double precision, plan_date date, gln_description text, parent text, name text)
    LANGUAGE sql
    AS $_$
	WITH RECURSIVE facility(hfid) AS (
		SELECT "ID" as hfid, "HEALTH_FACILITY"."CODE", "PARENT_ID" FROM "HEALTH_FACILITY" WHERE "CODE" = $1
		UNION
		SELECT "ID", "HEALTH_FACILITY"."CODE", facility.hfid FROM facility, "HEALTH_FACILITY" WHERE "HEALTH_FACILITY"."PARENT_ID" = facility.hfid
	),HFNAME as (SELECT "NAME" FROM "HEALTH_FACILITY" WHERE "CODE" = $1)
	
	SELECT
	p."planned_demand",
	p."plan_date",
	f."gln_description",
	HFNAME."NAME",
	i."NAME"	
	FROM "drp_plan" p
	JOIN "drp_facility" f on p."gln" = f."gln"
	JOIN "ITEM_LOT" l on l."GTIN" = p."gtin"
	JOIN "ITEM" i on l."ITEM_ID" = i."ID"
	CROSS JOIN HFNAME
	WHERE f."gln" IN (SELECT "CODE" FROM facility)
	ORDER BY f."gln_description";
$_$;


