				date_part('year'::text, "STOCK_TALLY"."ENTRY_DATE") = $3 AND
				"MONTH_NO" = $2) AS count
           FROM "VACCINATION_EVENT"
             JOIN "HEALTH_FACILITY" ON "HEALTH_FACILITY"."ID" = "VACCINATION_EVENT"."HEALTH_FACILITY_ID"
             JOIN "CHILD" ON "VACCINATION_EVENT"."CHILD_ID" = "CHILD"."ID"
          WHERE "VACCINATION_EVENT"."DOSE_ID" = $1 AND "VACCINATION_EVENT"."HEALTH_FACILITY_ID" = $4
          AND "VACCINATION_EVENT"."IS_ACTIVE" = true 
          AND "VACCINATION_EVENT"."VACCINATION_STATUS" = true 
          AND ("VACCINATION_EVENT"."VACCINATION_DATE" - "CHILD"."BIRTHDATE") <= $5 
          AND date_part('month'::text, "VACCINATION_EVENT"."VACCINATION_DATE") = $2
          AND date_part('year'::text, "VACCINATION_EVENT"."VACCINATION_DATE") = $3
$_$;


