CREATE FUNCTION facility_balance_report(facilityid integer, parentid integer) RETURNS TABLE(id integer, name text, parent_id integer, item_name text, parent_name text, hf_code text, gtin text, lot_number text, received real, distributed real, used real, wasted real, stock_count real, balance real, allocated real, cold_storage_capacity double precision, reorder_qty real, safety_stock real, avg_daily_demand_rate real, lead_time integer, forecast_period_demand real)
    LANGUAGE sql
    AS $_$
SELECT "HEALTH_FACILITY"."ID", "HEALTH_FACILITY"."NAME", PARENT."ID" AS "PARENT_ID", "ITEM"."NAME" AS "ITEM NAME", PARENT."NAME" AS "PARENT_NAME", "HEALTH_FACILITY_BALANCE".*, "HEALTH_FACILITY"."COLD_STORAGE_CAPACITY", "REORDER_QTY","SAFETY_STOCK","AVG_DAILY_DEMAND_RATE","LEAD_TIME", "FORECAST_PERIOD_DEMAND" FROM
	"HEALTH_FACILITY_BALANCE" INNER JOIN "HEALTH_FACILITY" ON ("HEALTH_FACILITY_BALANCE"."HEALTH_FACILITY_CODE" = "HEALTH_FACILITY"."CODE")
	INNER JOIN "GTIN_HF_STOCK_POLICY" USING ("HEALTH_FACILITY_CODE", "GTIN")
	INNER JOIN "HEALTH_FACILITY" PARENT ON ("HEALTH_FACILITY"."PARENT_ID" = PARENT."ID")
	INNER JOIN "ITEM_LOT" ON ("HEALTH_FACILITY_BALANCE"."GTIN" = "ITEM_LOT"."GTIN" AND "HEALTH_FACILITY_BALANCE"."LOT_NUMBER" = "ITEM_LOT"."LOT_NUMBER")
	INNER JOIN "ITEM" ON ("ITEM_LOT"."ITEM_ID" = "ITEM"."ID")
	WHERE PARENT."ID" = COALESCE($2,PARENT."ID") AND
	"HEALTH_FACILITY"."ID" = COALESCE($1, "HEALTH_FACILITY"."ID")
ORDER BY "HEALTH_FACILITY"."ID"
