--
-- TOC entry 409 (class 1255 OID 18526)
-- Name: facility_coverage(text, text, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION facility_coverage(fromdate text, todate text, parentid integer) RETURNS TABLE(name text, numerator real, cohort real, month_no double precision, month text, dose_name text, parent_name text, coverage real)
    LANGUAGE sql
    AS $_$
	SELECT *, ("NUMERATOR" / "COHORT")  AS "COVERAGE" FROM (

	WITH RECURSIVE facility(hfid) AS (
		SELECT "ID" as hfid, "PARENT_ID" FROM "HEALTH_FACILITY" WHERE "ID" = $3
		UNION
		SELECT "ID", facility.hfid FROM facility, "HEALTH_FACILITY" WHERE "HEALTH_FACILITY"."PARENT_ID" = facility.hfid
	)
	SELECT
	h."NAME",
	CAST(COUNT(d."ID") AS REAL) as "NUMERATOR",
	CAST(c."COHORT" AS REAL),
	v."MONTH" as "MONTH_NO",
	TO_CHAR(TO_TIMESTAMP(v."MONTH"::CHAR, 'MM'), 'MON') AS "MONTH",
	d."FULLNAME",
	(SELECT "NAME" FROM "HEALTH_FACILITY" WHERE "ID" = $3) as "PARENT_NAME"
		FROM (SELECT *, EXTRACT(MONTH FROM "VACCINATION_DATE") AS "MONTH" FROM "VACCINATION_EVENT") v
		JOIN "HEALTH_FACILITY" h ON v."HEALTH_FACILITY_ID" = h."ID"
		JOIN "DOSE" d ON v."DOSE_ID" = d."ID"
		INNER JOIN "HEALTH_FACILITY" p ON (h."PARENT_ID" = p."ID")
	INNER JOIN "HEALTH_FACILITY_COHORT_DATA" c ON (h."ID" = c."HEALTH_FACILITY_ID" AND c."YEAR" = EXTRACT(YEAR FROM v."VACCINATION_DATE"))
	AND v."VACCINATION_STATUS" = true
	AND v."VACCINATION_DATE" BETWEEN $1::DATE AND $2::DATE
	AND p."ID" IN (SELECT hfid FROM facility)
	GROUP BY h."NAME", d."ID", p."NAME", v."MONTH", c."COHORT"
	HAVING "COHORT" > 0
	ORDER BY h."NAME", v."MONTH", d."FULLNAME"
	) AS A
$_$;


