        CASE
            WHEN cw."WEIGHT" <= w."SD3neg"::double precision THEN 'SD<=-3'::text
            WHEN cw."WEIGHT" <= w."SD2neg"::double precision AND cw."WEIGHT" > w."SD3neg"::double precision THEN 'SD<=-2'::text
            WHEN cw."WEIGHT" >= w."SD2"::double precision AND cw."WEIGHT" < w."SD3"::double precision THEN 'SD>=2'::text
            WHEN cw."WEIGHT" >= w."SD3"::double precision THEN 'SD>=3'::text
            ELSE NULL::text
        END AS message
   FROM "CHILD_WEIGHT" cw
     JOIN "CHILD" c ON c."ID" = cw."CHILD_ID"
     JOIN "WEIGHT" w ON w."DAY" = (cw."DATE" - c."BIRTHDATE") AND w."GENDER"::text =
        CASE
            WHEN c."GENDER" = true THEN 'M'::text
            ELSE 'F'::text
        END
        where c."ID" = $1
  ORDER BY cw."MODIFIED_ON" DESC
  limit 1$_$;


