--

CREATE FUNCTION health_facility_balance_copy_journal() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- IF IT IS A DELETE WE WANT A COPY OF THE OLD RECORD (IE THE THING THAT WAS DELETED)
	IF(TG_ARGV[0] = 'D') THEN
			SELECT OLD.*, nextval('"JRNL_HLTH_FCLT_SEQ"'), CURRENT_TIMESTAMP, TG_ARGV[0];
		RETURN OLD;
	ELSE  -- OTHERWISE WE WANT A COPY OF WHAT WAS INSERTED OR UPDATED
			SELECT NEW.*, nextval('"JRNL_HLTH_FCLT_SEQ"'), CURRENT_TIMESTAMP, TG_ARGV[0];
		RETURN NEW;
	END IF;
END
$$;


