CREATE FUNCTION list_all_children(facilityid integer) RETURNS TABLE(id integer, system_id text, firstname1 text, firstname2 text, lastname1 text, lastname2 text, dob date, gender boolean, healthcenter_id integer, birthplace_id integer, community_id integer, domicile_id integer, status_id integer, address text, phone text, mobile text, email text, mother_id text, mother_f text, mother_l text, father_id text, father_f text, father_l text, caretaker_id text, caretaker_f text, caretaker_l text, notes text, is_active boolean, modified_on timestamp without time zone, modified_by integer, id_1 text, id_2 text, id_3 text, barcode text, temp_id text, facility text, village text, gender_human text)
    LANGUAGE sql
    AS $_$
SELECT * FROM (WITH RECURSIVE facility(hfid) AS (
	SELECT "ID" as hfid , "PARENT_ID" FROM "HEALTH_FACILITY" WHERE "ID" =$1
	UNION
	SELECT "ID", facility.hfid FROM facility, "HEALTH_FACILITY" WHERE "HEALTH_FACILITY"."PARENT_ID" = facility.hfid
)
