CREATE FUNCTION missed_vaccinations(hfid integer, villageid integer, parent integer) RETURNS TABLE(id integer, firstname text, lastname text, mother_f text, mother_l text, dob date, gender text, village_name text, phone text, hf_name text, vaccine text, due_time text, scheduled_date date, vaccination_date date)
    LANGUAGE sql
    AS $_$
SELECT * FROM (WITH RECURSIVE facility(hfid) AS (
	SELECT "ID" as hfid , "PARENT_ID" FROM "HEALTH_FACILITY" WHERE "ID" = $3
	UNION
	SELECT "ID", facility.hfid FROM facility, "HEALTH_FACILITY" WHERE "HEALTH_FACILITY"."PARENT_ID" = facility.hfid
)
SELECT DISTINCT ON(va."ID") c."ID", c."FIRSTNAME1", c."LASTNAME1", c."MOTHER_FIRSTNAME", c."MOTHER_LASTNAME", c."BIRTHDATE", CASE WHEN c."GENDER" THEN 'M' ELSE 'F' END AS "GENDER", p."NAME" AS "VILLAGE_NAME", c."PHONE", h."NAME" as "HF_NAME",
array_to_string(ARRAY(SELECT "FULLNAME" FROM "DOSE" INNER JOIN "VACCINATION_EVENT" ON
 ("DOSE"."ID" = "VACCINATION_EVENT"."DOSE_ID") WHERE "APPOINTMENT_ID" = va."ID"), ',') AS "VACCINE_DOSE", (((va."SCHEDULED_DATE" - c."BIRTHDATE") / 7) || ' Wk') AS "DUE_TIME", v."SCHEDULED_DATE", v."VACCINATION_DATE"
FROM "CHILD" c
	INNER JOIN "VACCINATION_APPOINTMENT" va ON c."ID" = va."CHILD_ID"
	INNER JOIN "VACCINATION_EVENT" v ON c."ID" = v."CHILD_ID"
	INNER JOIN "DOSE" d on v."DOSE_ID" = d."ID"
	INNER JOIN "PLACE" p ON (p."ID" = c."DOMICILE_ID")
	INNER JOIN "HEALTH_FACILITY" h ON (h."ID" = c."HEALTHCENTER_ID")
WHERE c."HEALTHCENTER_ID" IN (SELECT hfid FROM facility)
	AND v."IS_ACTIVE" = true
	AND va."IS_ACTIVE" = true
	AND v."VACCINATION_STATUS" = false
	AND v."NONVACCINATION_REASON_ID" = 0
	AND v."SCHEDULED_DATE" + '3 DAYS'::INTERVAL <= current_date
	AND c."STATUS_ID" = 1
	AND c."DOMICILE_ID" = COALESCE($2, c."DOMICILE_ID")
	AND c."HEALTHCENTER_ID" = COALESCE($1, c."HEALTHCENTER_ID")
ORDER BY va."ID") AS FOO
$_$;


