--
-- TOC entry 462 (class 1255 OID 18653)
-- Name: openvial_helper(integer, text, text, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION openvial_helper(hfid integer, firstdate text, todate text, vaccineid integer) RETURNS void
    LANGUAGE plpgsql
    AS $$
                DECLARE
                    v_parent_rec RECORD;
                BEGIN

                    FOR v_parent_rec IN SELECT "ID" FROM "HEALTH_FACILITY" WHERE ("ID" = hfId OR "PARENT_ID" = hfId) AND "IS_ACTIVE" = true 
				     ORDER BY "PARENT_ID" Desc 
	                LOOP
        

                        select
		                (
                                       (
			                select "ID" FROM "HEALTH_FACILITY" WHERE "ID" = v_parent_rec."ID"
			
			                ), (
			                select "NAME" FROM "HEALTH_FACILITY" WHERE "ID" = v_parent_rec."ID"
			
			                ), ( -- open balance
			
					Select "BALANCE" from "HEALTH_FACILITY_BALANCE" where "HEALTH_FACILITY_ID" = v_parent_rec."ID"
					AND "ITEM_ID" = vaccineId and "DATE" <= cast(firstdate as date) ORDER BY "DATE" DESC LIMIT 1
			               
			                ) ,( -- received
			  
			                Select SUM("RECEIVED") from "HEALTH_FACILITY_BALANCE" where "HEALTH_FACILITY_ID" = v_parent_rec."ID"
					AND "ITEM_ID" = vaccineId and "DATE" between cast(firstdate as date) and cast(todate as date)
			
			                ),( --closing balance

			                Select "BALANCE" from "HEALTH_FACILITY_BALANCE" where "HEALTH_FACILITY_ID" = v_parent_rec."ID"
					AND "ITEM_ID" = vaccineId and "DATE" <= cast(todate as date) ORDER BY "DATE" DESC LIMIT 1
                                        ), (-- used
                                        
					Select SUM("USED") from "HEALTH_FACILITY_BALANCE" where "HEALTH_FACILITY_ID" in (1,2,3,4,5,8,9,10)
					AND "ITEM_ID" = vaccineId and "DATE" between cast(firstdate as date) and cast(todate as date)
                                        ), ( -- wasted total
                                        
			                Select "WASTED" from "HEALTH_FACILITY_BALANCE" where "HEALTH_FACILITY_ID" = v_parent_rec."ID"
					AND "ITEM_ID" = vaccineId and "DATE" <= cast(todate as date) ORDER BY "DATE" DESC LIMIT 1
                                        ), ( -- correction

                                        Select SUM("TRANSACTION_LINES"."QUANTITY") from "TRANSACTION_LINES" join "TRANSACTION" on "TRANSACTION_LINES"."TRANSACTION_ID" = "TRANSACTION"."ID"
                                        join "ITEM_LOT" on "TRANSACTION_LINES"."ITEM_LOT_ID" = "ITEM_LOT"."ID"
                                        where "HEALTH_FACILITY_ID" = v_parent_rec."ID" AND "ITEM_ID" = vaccineId AND "TRANSACTION"."STATUS" = 1 AND "TRANSACTION_LINES"."IS_ACTIVE" = true
                                        AND "ADJUSTMENT_ID" = 99
                                        )
                                        
                           

		                );

                    END LOOP;
                    RETURN;
                END;
                $$;


