CREATE FUNCTION pack_order_report(f_from text, f_to text, order_no integer, status integer) RETURNS TABLE(order_no integer, sched_replenish_date date, f_from text, f_to text, order_status text)
    LANGUAGE sql
    AS $_$
SELECT DISTINCT "ORDER_NUM", "ORDER_SCHED_REPLENISH_DATE", "FROM", "TO",
	CASE WHEN "ORDER_STATUS" = 0 THEN 'REQUESTED' 
	WHEN "ORDER_STATUS" = 1 THEN 'RELEASED' 
	WHEN "ORDER_STATUS" = 2 THEN 'PACKED' 
	WHEN "ORDER_STATUS" = 3 THEN 'SHIPPED' 
	WHEN "ORDER_STATUS" = 4 THEN 'CANCELLED' END AS "ORDER_STATUS" 
	FROM pick_pack_ship
	WHERE "ORDER_FACILITY_FROM" = COALESCE($1, "ORDER_FACILITY_FROM") AND
	"ORDER_FACILITY_TO" = COALESCE($2, "ORDER_FACILITY_TO") AND
	"ORDER_STATUS" = COALESCE($4,"ORDER_STATUS") AND
	"ORDER_NUM" = COALESCE($3,"ORDER_NUM")
$_$;


--
-- TOC entry 433 (class 1255 OID 18655)
-- Name: planned_coverage(text, text, text, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION planned_coverage(sdfrom text, sdto text, dateend text, hfid integer) RETURNS TABLE(allcount bigint, vaccinated bigint, nr29 bigint, nr30 bigint, nr32 bigint, nr33 bigint, name text, fullname text, unvaccinated bigint)
    LANGUAGE sql
    AS $_$
SELECT *,
(a."ALL" - a."VACCINATED") as "UNVACCINATED"
FROM (
WITH RECURSIVE facility(hfid) AS (
	SELECT "ID" as hfid, "PARENT_ID" FROM "HEALTH_FACILITY" WHERE "ID" = $4
	UNION
	SELECT "ID", facility.hfid FROM facility, "HEALTH_FACILITY" WHERE "HEALTH_FACILITY"."PARENT_ID" = facility.hfid
),
HFNAME as (
	SELECT "NAME" FROM "HEALTH_FACILITY" WHERE "ID" = $4
)
SELECT
COUNT(*) as "ALL",
COUNT(CASE v."VACCINATION_STATUS" WHEN TRUE THEN 1 ELSE NULL END) as "VACCINATED",
COUNT(CASE v."NONVACCINATION_REASON_ID" WHEN 29 THEN 1 ELSE NULL END) as "Mzazi amekataa",
COUNT(CASE v."NONVACCINATION_REASON_ID" WHEN 30 THEN 1 ELSE NULL END) as "Mtoto ana aleji ya dawa",
COUNT(CASE v."NONVACCINATION_REASON_ID" WHEN 32 THEN 1 ELSE NULL END) as "Kukosekana chanjo",
COUNT(CASE v."NONVACCINATION_REASON_ID" WHEN 33 THEN 1 ELSE NULL END) as "Mtoto ni mgonjwa",
HFNAME."NAME",
d."FULLNAME"
FROM "CHILD" c
JOIN "VACCINATION_EVENT" v on c."ID" = v."CHILD_ID"
JOIN "DOSE" d on v."DOSE_ID" = d."ID"
CROSS JOIN HFNAME
WHERE v."IS_ACTIVE" = TRUE
AND v."VACCINATION_DATE" < $3::DATE
AND v."SCHEDULED_DATE" BETWEEN $1::DATE AND $2::DATE
AND v."HEALTH_FACILITY_ID" IN (SELECT hfid FROM facility)
GROUP BY d."FULLNAME", HFNAME."NAME"
