--
-- TOC entry 442 (class 1255 OID 18663)
-- Name: vaccine_report_barcode(integer, integer, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION vaccine_report_barcode(facility integer, month integer, year integer) RETURNS TABLE(id integer, hc_id integer, fname text, lname text, dob date, gender boolean, address text, phone text, mother_f text, mother_l text, barcode_id text, temp_id text, scheduled_date date, hf_name text, c_name text, vaccines text)
    LANGUAGE sql
    AS $_$
SELECT DISTINCT ON (c."ID") c."ID",
    c."HEALTHCENTER_ID",
    c."FIRSTNAME1",
    c."LASTNAME1",
    c."BIRTHDATE",
    c."GENDER",
    c."ADDRESS",
    c."PHONE",
    c."MOTHER_FIRSTNAME",
    c."MOTHER_LASTNAME",
    CASE WHEN c."BARCODE_ID" IS NULL OR c."BARCODE_ID" = '' THEN
	LPAD(c."ID"::TEXT, 10, 'T')
    ELSE
	"BARCODE_ID"
    END AS "BARCODE_ID",
    c."TEMP_ID",
    v."SCHEDULED_DATE",
    h."NAME" as hf_name,
    "COMMUNITY"."NAME" as  c_name,
    array_to_string(ARRAY( SELECT "DOSE_1"."FULLNAME"
           FROM "CHILD" b
             JOIN "VACCINATION_EVENT" ON c."ID" = "VACCINATION_EVENT"."CHILD_ID"
             JOIN "DOSE" "DOSE_1" ON "VACCINATION_EVENT"."DOSE_ID" = "DOSE_1"."ID"
          WHERE EXTRACT(YEAR FROM "VACCINATION_EVENT"."SCHEDULED_DATE") = $3 AND EXTRACT(MONTH FROM "VACCINATION_EVENT"."SCHEDULED_DATE") BETWEEN $2 -1 AND $2 
          AND "DOSE_1"."ID" = "VACCINATION_EVENT"."DOSE_ID" AND "VACCINATION_EVENT"."IS_ACTIVE" = true AND "VACCINATION_EVENT"."VACCINATION_STATUS" = false 
          AND "VACCINATION_EVENT"."NONVACCINATION_REASON_ID" = 0 AND c."ID" = b."ID" AND "DOSE_1"."ID" = "VACCINATION_EVENT"."DOSE_ID"), ', '::text) AS vaccines
   FROM "CHILD" c
     LEFT JOIN "COMMUNITY" ON c."COMMUNITY_ID" = "COMMUNITY"."ID"
     JOIN "VACCINATION_EVENT" v ON c."ID" = v."CHILD_ID"
     JOIN "DOSE" ON v."DOSE_ID" = "DOSE"."ID"
     JOIN "HEALTH_FACILITY" h on c."HEALTHCENTER_ID" = h."ID"
  WHERE EXTRACT(MONTH FROM v."SCHEDULED_DATE") BETWEEN $2 -1 AND $2
	AND EXTRACT(YEAR FROM v."SCHEDULED_DATE") = $3
	AND "DOSE"."ID" = v."DOSE_ID"
	AND c."STATUS_ID" = 1
	AND v."IS_ACTIVE" = true
	AND v."VACCINATION_STATUS" = false
	AND v."NONVACCINATION_REASON_ID" = 0
	AND c."HEALTHCENTER_ID" = $1
  GROUP BY c."ID", v."SCHEDULED_DATE", "COMMUNITY"."NAME", h."NAME";
$_$;


