--
-- TOC entry 445 (class 1255 OID 18666)
-- Name: vaccines_administered(text, integer, text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION vaccines_administered(fromdate text, parentid integer, todate text) RETURNS TABLE(name text, usage bigint, month_no double precision, month text, fullname text, parent_name text)
    LANGUAGE sql
    AS $_$
	SELECT
	h."NAME",
	COUNT(d."ID") as "USAGE",
	v."MONTH" as "MONTH_NO",
	TO_CHAR(TO_TIMESTAMP(v."MONTH"::CHAR, 'MM'), 'MON') AS "MONTH",
	d."FULLNAME",
	p."NAME" as "PARENT_NAME"
	FROM (SELECT *, EXTRACT(MONTH FROM "VACCINATION_DATE") AS "MONTH" FROM "VACCINATION_EVENT") v
	JOIN "HEALTH_FACILITY" h ON v."HEALTH_FACILITY_ID" = h."ID"
	JOIN "DOSE" d ON v."DOSE_ID" = d."ID"
	INNER JOIN "HEALTH_FACILITY" p ON (h."PARENT_ID" = p."ID")
	AND v."VACCINATION_STATUS" = true
	AND v."VACCINATION_DATE" BETWEEN $1::DATE AND $3::DATE
	AND p."ID" = $2
	GROUP BY h."NAME", d."ID", p."NAME", v."MONTH"
	ORDER BY h."NAME", v."MONTH", d."FULLNAME"
$_$;


