CREATE VIEW tmp_register AS
 SELECT DISTINCT "CHILD"."ID",
    "CHILD"."FIRSTNAME1" AS "FIRSTNAME",
    "CHILD"."LASTNAME1" AS "LASTNAME",
    "CHILD"."BIRTHDATE",
    "DOSE"."FULLNAME" AS "Vaccine",
    "VACCINATION_EVENT"."VACCINATION_DATE" AS "DATE",
        CASE
            WHEN ("CHILD"."STATUS_ID" = 1) THEN 'Aktiv'::text
            WHEN ("CHILD"."STATUS_ID" = 2) THEN 'Levizur'::text
            WHEN ("CHILD"."STATUS_ID" = 3) THEN 'Vdekur'::text
            ELSE NULL::text
        END AS "STATUS",
    "HEALTH_FACILITY"."NAME" AS "H.CENTER",
    "HEALTH_FACILITY"."ID" AS "ADMINISTRATION_ID",
    "HEALTH_FACILITY"."TOP_LEVEL",
    "VACCINATION_EVENT"."VACCINATION_STATUS" AS "VSTATUS",
    "NONVACCINATION_REASON"."NAME" AS "REASON"
   FROM (((("DOSE"
     JOIN "VACCINATION_EVENT" ON (("VACCINATION_EVENT"."DOSE_ID" = "DOSE"."ID")))
     JOIN "CHILD" ON (("VACCINATION_EVENT"."CHILD_ID" = "CHILD"."ID")))
     JOIN "HEALTH_FACILITY" ON (("HEALTH_FACILITY"."ID" = "CHILD"."HEALTHCENTER_ID")))
     LEFT JOIN "NONVACCINATION_REASON" ON (("VACCINATION_EVENT"."NONVACCINATION_REASON_ID" = "NONVACCINATION_REASON"."ID")))
  WHERE ("CHILD"."STATUS_ID" = ANY (ARRAY[1, 2, 3]));


